import Game from './Game'
import { popularGames } from '../data'
import styled from 'styled-components'

const Container = styled.div`
  padding: 20px;
  display: flex;
  flex-wrap: wrap;
`

const Games = () => {
  return (
    <Container>
      {popularGames.map((item) => (
        <Game item={item} key={item.id} />
      ))}
    </Container>
  )
}

export default Games
